import React from 'react';
import AllStudentsGraph from '../../containers/AllStudentsGraph.js';
import StudentsGraph from '../../containers/StudentsGraph.js';
import { render } from 'react-dom';
import Data from '../Data/Data';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';

// import ChartExample from "../ChartExample/ChartExample";

class App extends React.Component {
	constructor() {
		super();
		this.state = {
			dataList: Data
		};
	}

	render() {
		return (
			<Router>
				<div>
					<ul style={{ textAlign: 'center', display: 'inline', listStyle: 'none' }}>
						<li>
							<Link to="/">Home</Link>
						</li>
						<li>
							<Link to="/StudentsGraph">Students</Link>
						</li>
					</ul>

					<hr />
					<Switch>
						<Route exact path="/">
							<AllStudentsGraph data={this.state.dataList} />
						</Route>
						<Route path="/StudentsGraph">
							<StudentsGraph data={this.state.dataList} />
						</Route>
					</Switch>
				</div>
			</Router>
		);
	}
}

export default App;
